import React from 'react';
import './LocalLaw.css';

function LocalLaw() {
  return (
    <div className="local-law-container">
      <div className="local-law-background">
        <div className="local-law-content">
          <h1>Local LAW 11</h1>
        </div>
      </div>
    </div>
  );
}

export default LocalLaw;
